import Header from "../components/Header.js";
export default class Projects extends React.Component {
  constructor() {
    super();
    this.state = {}
  }
  componentDidMount() {
    console.log("ieuthsi");
  }
  render() {
    return(
      <div className="container">
      <Header/>
        <div className="homeImg">
            <div className="homeDiv center">
                <h1 className="titleMain">DEVON CRAWFORD</h1>
                <h3>an electronics hobbyist passionate for innovative technology and digital content</h3>
            </div>
            <div className="homeSouth">
                <h4><a className="stealthLink subPmin padX0" href="#">Read More</a></h4>
                <button className="smoothScrollBtn" type="button"><img src="/images/Down-Arrow-White.png" width="30"/></button>
            </div>
        </div>
      </div>

    );
  }
}
